Back-to-back shoots, sore feet, and 4-inch heels, but somewhere in between, I started falling in love with the walk. It wasn’t just about looking graceful. It was about posture, timing, presence, and the technique behind every step🚶‍♀️

I am grateful to have trained by the best in the industry 💁🏻‍♀️😇

@lubna.adam - with 20+ years in fashion, a powerhouse, and a name every ramp respects 🫡 

@kavitakharayatk - the iconic model from Fashion Movie and Miss World India 2025 trainer 🌟

@sunnykamble - our walk trainer and stylist, who guided us patiently on posing, expression, and how to carry ourselves with confidence🔥

@jamaimajames - sweet, kind, full of fun, and always handling everything effortlessly🪄

And when @kavitakharayatk Mam said, “Your walk yesterday was nice,” I knew it was all coming together 🫠💃

👠From balancing to genuinely enjoying walking in heels - this journey has been everything. 🧿

